/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
    if (!s) return 0;
    var hash = {}, maxLen = 0, left = 0, right = 0, end = s.length;

    while (left < end && right < end) {
        if (s[right] in hash) {
            delete hash[s[left++]];
        } else {
            hash[s[right++]] = 1;
            maxLen = Math.max(right - left, maxLen);
        }
    }

    return maxLen;
};

